import React, { useState } from 'react';
import './MyWork.css';

const MyWork = () => {
  const [showDropdown, setShowDropdown] = useState(false);

  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };

  return (
    <div className="my-work card">
      <div className="header">
        <h2>My Work</h2>
        <div className="actions">
          <button className="icon-button">+</button>
          <div className="settings">
            <button className="icon-button" onClick={toggleDropdown}>...</button>
            {showDropdown && (
              <div className="dropdown">
                <button className="remove-card-button">Remove card</button>
              </div>
            )}
          </div>
        </div>
      </div>
      <div className="empty-state">
        <div className="file-icon">ðŸ“„</div>
        <p>Tasks and Reminders assigned to you will show here. <a href="#">Learn more</a></p>
        <button className="add-task">+ Add task or reminder</button>
      </div>
    </div>
  );
};

export default MyWork;
